import './teamcard.css'
// TeamCards.jsx

import React from "react";

function TeamCards(props) {
  const { Id, Name, Image, Title, Description } = props.Data;

  return (
    <div className="card p-2 m-2 h-100 text-center shadow-sm">
      <img
        className="teamimg img-fluid card-img-top"
        src={Image}
        alt={`${Name}'s profile`}
        style={{ height: "200px", objectFit: "cover" }}
      />
      <div className="card-body">
        <h6 className="text-muted">ID: {Id}</h6>
        <h5 className="text-success">{Name}</h5>
        <h6 className="text-info">{Title}</h6>
        <p className="text-secondary small">{Description}</p>
      </div>
    </div>
  );
}

export default TeamCards;
